import React from 'react'
import { useNavigate } from 'react-router-dom'

const User = () => {
const  Navigate= useNavigate();

const Home = () => {
Navigate('/');
}
  return (
<>
<h1>This is User Page</h1><br/>
<button onClick={Home}>Homepage</button>
</>  
)
}

export default User
